import React from "react";
import { Link, Route, Routes } from "react-router-dom";
import "./dashboard.css";
import AchievementDropdown from "./achievements/achievements" 
import LogoutButton from "./logout/logout";

const Dashboard = () => {
  return (
    <div className="main">
      

      <div className="other">
        <ul>
          <li>
            <Link to="/dashboard/ChatSystem">Chat System</Link>
          </li>
          <li>
            <Link to="/dashboard/achievements">Track Achievements</Link>
          </li>
          <li>
            <Link to="/dashboard/progressreport">View Progress Report</Link>
          </li>
        </ul>
      </div>
      <div className="logout-button-container"> <LogoutButton />
      </div>


      <Routes>
       
      <Route path="/dashboard/achievements" element={<AchievementDropdown />} />
        <Route path="/dashboard/progressreport" element={<report />} />
      </Routes>
    </div>
  );
};

export default Dashboard;
